import React from 'react'

const actor = 'shyam'

const dancer = 'rajput'

function firstCom() {
  let name = 'ShyamRaj'
  return name
}

function secondCom() {
  let name2 = 'ShyamRaj'
  return name2
}

export default actor
export { dancer, firstCom, secondCom }

// here 'actor' and 'dancer' is a variables, and  'firstCom' and 'secondCom' is a function not a component isliye jab ham isliye ab ye variables and functions ko ham jab index.js file me import karenge to bho Object ke form me import honge isliye ham inhe render method ke ander curly bracket {} ke ander add karenge.
